import React from 'react';
import homeimg from '../Images/homepageimg.avif'
import {NavLink} from 'react-router-dom';

const Card=(props)=>{
    return(
        <>
    <div className="card">
            <h2>{p}</h2>
            <img src={homeimg} alt="course1" className="coursesImg"/>
            <p>In a web development course, students learn the fundamentals of creating and maintaining websites using HTML, CSS, JavaScript, and other programming languages and tools.</p>
            <div className="btnBox">
               <div className="btn">
               <NavLink to="/about"className="readmore"
               >Start Learning</NavLink>
                </div> 
            </div>
        </div>
        </>
    )
}
export default Card;
